import React from 'react'
import Navbar from './Nav/Navbar';
import './Home.css';
import {useTranslation} from "react-i18next";

function HeaderComponent()
{
    const {t, i18n} = useTranslation('common');
    return <h1>{t('welcome.title')}</h1>
}


function Home() {
    return (
        <div className="home">
            <HeaderComponent/>
            <Navbar />
        </div>
    )
}

export default Home
